import {useEffect, useState} from 'react'
export default function App() {

  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('/api')
      .then(res => res.json())
      .then(res => setData(res.message));
  }, []);

  return (
    <div className='links'>
      <div className='object'>GET /posts</div>
      <div className='object'>GET /posts/:id</div>
      <div className='object'>POST /posts</div>
      <div className='object'>DELETE /posts/:id</div>
      <div className='object'>PATCH /posts/:id</div>
      <div className='object'>GET /api</div>
      <div className='object'>GET /posts</div>
      <div className='object'>GET /posts</div>

    </div>
  );
}
